/*  _____ _______         _                      _
 * |_   _|__   __|       | |                    | |
 *   | |    | |_ __   ___| |___      _____  _ __| | __  ___ ____
 *   | |    | | '_ \ / _ \ __\ \ /\ / / _ \| '__| |/ / / __|_  /
 *  _| |_   | | | | |  __/ |_ \ V  V / (_) | |  |   < | (__ / /
 * |_____|  |_|_| |_|\___|\__| \_/\_/ \___/|_|  |_|\_(_)___/___|
 *                                _
 *              ___ ___ ___ _____|_|_ _ _____
 *             | . |  _| -_|     | | | |     |  LICENCE
 *             |  _|_| |___|_|_|_|_|___|_|_|_|
 *             |_|
 *
 *   PROGRAMOVÁNÍ  <>  DESIGN  <>  PRÁCE/PODNIKÁNÍ  <>  HW A SW
 *
 * Tento zdrojový kód je součástí výukových seriálů na
 * IT sociální síti WWW.ITNETWORK.CZ
 *
 * Kód spadá pod licenci prémiového obsahu a vznikl díky podpoře
 * našich členů. Je určen pouze pro osobní užití a nesmí být šířen.
 * Více informací na http://www.itnetwork.cz/licence
 */

import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { apiGet } from "../utils/api";
import Country from "./Country";

const PersonDetail = () => {
    const { id } = useParams();
    const [person, setPerson] = useState({});
    const [invoiceSeller, setInvoiceSeller] = useState([]);
    const [invoiceBuyer, setInvoiceBuyer] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                // Fetch the person data
                const personData = await apiGet(`/api/persons/${id}`);
                setPerson(personData);

                // Extract ICO from person data
                const ico = personData.identificationNumber;

                // Fetch the seller and buyer invoices using the ICO
                const sellerData = await apiGet(`/api/${ico}/sales`);
                setInvoiceSeller(sellerData);

                const buyerData = await apiGet(`/api/${ico}/buyer`);
                setInvoiceBuyer(buyerData);
            } catch (error) {
                console.error("Error fetching data", error);
            }
        };

        fetchData();
    }, [id]);

    const country = Country.CZECHIA === person.country ? "Česká republika" : "Slovensko";

    return (
        <>
            <div>
                <h1>Detail osoby</h1>
                <hr />
                <h3>{person.name} ({person.identificationNumber})</h3>
                <p><strong>DIČ:</strong><br />{person.taxNumber}</p>
                <p><strong>Bankovní účet:</strong><br />{person.accountNumber}/{person.bankCode} ({person.iban})</p>
                <p><strong>Tel.:</strong><br />{person.telephone}</p>
                <p><strong>Mail:</strong><br />{person.mail}</p>
                <p><strong>Sídlo:</strong><br />{person.street}, {person.city}, {person.zip}, {country}</p>
                <p><strong>Poznámka:</strong><br />{person.note}</p>
            </div>

            <div className="container">
                <div className="row">
                    <div className="col-md-6">
                        <h4>Vystavené faktury</h4>
                        <table className="table table-bordered">
                            <thead>
                                <tr>
                                    <th>Číslo faktury</th>
                                    <th>Datum vystavení</th>
                                    <th>Datum splatnosti</th>
                                    <th>Cena</th>
                                </tr>
                            </thead>
                            <tbody>
                                {invoiceSeller.length > 0 ? invoiceSeller.map((invoice) => (
                                    <tr key={invoice.invoiceNumber}>
                                        <td>{invoice.invoiceNumber}</td>
                                        <td>{invoice.issued}</td>
                                        <td>{invoice.dueDate}</td>
                                        <td>{invoice.price}</td>
                                    </tr>
                                )) : <tr><td colSpan="4">Žádné data</td></tr>}
                            </tbody>
                        </table>
                    </div>
                    <div className="col-md-6">
                        <h4>Přijaté faktury</h4>
                        <table className="table table-bordered">
                            <thead>
                                <tr>
                                    <th>Číslo faktury</th>
                                    <th>Datum vystavení</th>
                                    <th>Datum splatnosti</th>
                                    <th>Cena</th>
                                </tr>
                            </thead>
                            <tbody>
                                {invoiceBuyer.length > 0 ? invoiceBuyer.map((invoice) => (
                                    <tr key={invoice.invoiceNumber}>
                                        <td>{invoice.invoiceNumber}</td>
                                        <td>{invoice.issued}</td>
                                        <td>{invoice.dueDate}</td>
                                        <td>{invoice.price}</td>
                                    </tr>
                                )) : <tr><td colSpan="4">Žádné data</td></tr>}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        </>
    );
};

export default PersonDetail;
